pr_body:
@st0012 pointed out the problem that test framework doesn't support multiple assert methods after one command.
https://github.com/ruby/debug/pull/103#discussion_r656355053
This PR will fix it.

@ko1 pointed out that the file generated by test builder doesn't display line number correctly. The reason is that counting the line number from index was wrong.

I also refactored the part.
